🐶 UNA TARDE CANINA EN LAS MONTAÑAS FUEGUINAS
Hugo Flores lleva 30 años viviendo en Tierra del Fuego con perros, criándolos, saliendo al bosque con ellos: en trineos en invierno –llevando turistas-- y al trote en verano. Parece un personaje de Jack London, barbado e hiperactivo, pendiente de sus 132 perros siberianos y alaskan huskies.

💬 “Los criadores que abrazamos esta profesión somos un eslabón de aquellos hombres que convivían con los perros primitivos en un pasado milenario”, expresa. 

Leé la nota de @julianvarsavsky en el link de la bio.

